import {Card} from 'antd';
const Info = () => {
	return (
	<div className="info">
		<style jsx>{`
		.title {
			text-align: center;

		}
		`}</style>
		<div className="title">
			뇌솔드 (뇌제 솔로 레이드)
		</div>
		<Card title="1. 공속 순서" style={{ width: 500, margin: 10 }}>
			<p>
				빛카우걸(불하르퓨) → 불하르퓨(빛카우걸) → 뇌제 → 암바이킹 → 물워베어 <br/>
				(리더몹과 물워베어는 시작하자마자 사망이라 공속 중요x. 단, 머리보다 느릴 것)
			</p>
		</Card>
		<Card title="2. 몹 뒷속 제"  style={{ width: 500, margin: 10 }}>
			<p>
				빛카우걸(불하르퓨) → 불하르퓨(빛카우걸) → 뇌제 → 암바이킹 → 물워베어 <br/>
				(리더몹과 물워베어는 시작하자마자 사망이라 공속 중요x. 단, 머리보다 느릴 것)
			</p>
		</Card>
	</div>
	)
};

export default Info
